INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div><img src="/drupal7/alphorn/sites/default/files/images/footer2_400.jpg"></div>\r\n<p>Nunc pulvinar, sem at vestibulum dictum, augue lectus commodo velit, eu commodo quam nisl ut urna. Nullam laoreet diam non dui porttitor commodo. Sed scelerisque molestie mollis. Proin sit amet massa velit. Phasellus vestibulum ante id eros aliquet et mollis.</p>\r\n', 'Custom Block 2', 'full_html'),
(2, '<table class="no-border">\r\n	<tbody>\r\n		<tr>\r\n			<td class="rtecenter"><img alt="Home" height="31" src="/drupal7/alphorn/sites/default/files/images/icon_rss.png" width="32"></td>\r\n			<td class="rtecenter"><a href="#"><img alt="Home" height="31" src="/drupal7/alphorn/sites/default/files/images/icon_facebook.png" width="32"></a></td>\r\n			<td class="rtecenter"><a href="#"><img alt="Home" height="31" src="/drupal7/alphorn/sites/default/files/images/icon_twitter.png" width="32"></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'Social Icons', 'full_html'),
(3, '<div><img src="/drupal7/alphorn/sites/default/files/images/footer1_400.jpg"></div>\r\n<p>Vivamus congue risus ipsum. Fusce in leo lectus. Duis rhoncus mi ac felis condimentum blandit. In ac ipsum ligula, non semper enim. Nunc bibendum gravida tellus tempus ullamcorper. Aenean ac congue turpis. Ut tincidunt varius risus, eu tincidunt massa.</p>\r\n', 'Custom Block 1', 'full_html'),
(4, '<div><img src="/drupal7/alphorn/sites/default/files/images/footer3_400.jpg"></div>\r\n<p>Aliquam et ligula mi. Aliquam vestibulum ante eros. Praesent auctor tincidunt nisi, vitae gravida nunc consequat in. Praesent tellus quam, tempus nec interdum quis, mattis eu arcu. Integer laoreet accumsan porttitor.</p>\r\n', 'Custom Block 3', 'full_html'),
(5, '<div><img src="/drupal7/alphorn/sites/default/files/images/footer4_400.jpg"></div>\r\n<p>Quisque eu risus eget tellus convallis mattis a et sem. Mauris bibendum risus vitae odio euismod non dictum est adipiscing. Praesent ipsum magna, feugiat aliquet congue a, tristique sit amet justo. Odio euismod non dictum est adipiscing</p>\r\n<p>\r\n	<meta content="text/html; charset=utf-8" http-equiv="content-type">\r\n</p>\r\n', 'Custom Block 4', 'full_html'),
(6, '<p style="text-align: right;">Power by <a href="http://drupal.org">Drupal</a> and <a href="http://www.symphonythemes.com" title="SymphonyThemes">SymphonyThemes</a>.</p>\r\n', 'Copyright', 'full_html'),
(7, '<p><img src="/drupal7/alphorn/sites/default/files/images/logo-footer.png"></p>\r\n', 'Footer logo', 'full_html');
